function Vids() {
  return (
    <>
      <div className="vids">
        <div className="thumbnail">
        </div>
        <div className="chnl_text">
          <div className="chnl_pic">
          </div>
          <div className="vid_desc">
            hi welcome to my channel
          </div>
        </div>
      </div>
    </>
  )
}

const arr = [1, 2, 3 ,4, 5, 6, 7, 8, 9];

const Home = () => {
    
    return(
      <>
      <div className="scroll_top">
        <div className="All">
          All
        </div>
      </div>

      <div className="vid_holder">

        {/* <div className="vids">

        </div> */}
        {arr.map(() => <Vids />)}

        
      </div>
      </>
    )

  };
  
  export default Home;
